import React,{Component,TextField} from 'react';
import "./Contact.css";
class Contact extends Component{
    render(){

        return(
            <div id="contact-container" className="contact-container">
                <div className="contact-box" >
                <div className="contact-info"></div>
                <div className="contact-header">Send your message</div>
                <form className="contact-form">
                <input id="contact-name" type="text" name="name" placeholder="Your name.."/>
                <input id="contact-email" type="email" name="email" placeholder="Your email.."/>
                <input id="contact-id" type="text" name="subject" placeholder="subject"/>
                <textarea id="message" name="message" placeholder="Write something.."></textarea>
                <input id="submit button" type="submit" value="Submit" />
                </form>
                </div>
            </div>
        );
    }
}

export default Contact;
